import React from 'react';
import CurrencyConverter from './components/CurrencyConverter';

function App() {
  return (
    <div className="min-h-screen bg-gray-100 flex flex-col items-center justify-center p-6">
      <header className="text-center mb-8">
        <h1 className="text-4xl font-bold text-blue-600">Currency Converter</h1>
        <p className="text-gray-600">Convert currencies in real-time with live rates.</p>
      </header>
      <main className="w-full max-w-lg bg-white rounded-lg shadow p-6">
        <CurrencyConverter />
      </main>
    </div>
  );
}

export default App;
